def candidate(breed_size, human_year):
    """
    Calculates a dog's age in human years based on its breed and size.

    Args:
        breed_size (str): The size of the dog ('small', 'medium', or 'large').
        human_year (int): The number of human years to calculate dog age for.

    Returns:
        int: The calculated dog age in human years.
    """
    # Assign a multiplier based on the dog's breed
    if breed_size == 'small':
        return round(human_year * 7 / 2.5)
    elif breed_size == 'medium':
        return round(human_year * 2)
    elif breed_size == 'large':
        return round(human_year * 5)
    else:
        raise ValueError("Invalid breed size. Please enter 'small', 'medium', or 'large'.")
